import React from 'react'
import '../../Style/SearchBar.css'

function SearchBar() {
    return (
        <div className='searchbar-container'>
            <div className='searchbar-box'>
                <div>hello</div>
                <div>may cung</div>
            </div>
        </div>
    )
}

export default SearchBar
